import React, { useState, useEffect } from "react";
import Card from "../shared/UIElements/Card";

const SearchResults = ({ searchList }) => {
  return (
    <div className="row">
      {searchList && searchList.map((item) => <Card {...item} />)}
    </div>
  );
};

export default SearchResults;
